import SelectPlayer from './SelectPlayer'
import axios from 'axios'
import { useMemo, useState, useEffect } from 'react'



const SelectPlayerController = () => {
  const [data, setData] = useState([])

  const fetchData = () => {
    axios
      .get('http://localhost:3000/player/players')
      .then((res) => res.data)
      .then((data) => {
        const filteredData = data
          .filter((player) => player.current_club === 'Liverpool')
          .map((element) => {
            return {
              full_name: element.full_name,
            }
          })
        setData(filteredData)
      })
  }

  if (data === undefined) {
    fetchData()
  }

  const addDataChart = () => {
    data?.forEach((element) => {
      comboBoxData.push({
        full_name: element.full_name,
      })
    })

    console.log(comboBoxData)
  }

  useEffect(() => {
    addDataChart()
  }, [])

  return (
    <div>
      <SelectPlayer data={comboBoxData} />
    </div>
  )
}

export default SelectPlayerController
